            // S√©lectionner tous les boutons avec la classe 'copyButton'
            const buttons = document.querySelectorAll(".copyButton");

            // Ajouter un √©v√©nement de clic droit √† chaque bouton
            buttons.forEach(button => {
                button.addEventListener("contextmenu", function(event) {
                    event.preventDefault();  // Emp√™che le menu contextuel par d√©faut

                    // Copier le contenu textuel du bouton dans le presse-papiers
                    navigator.clipboard.writeText(button.textContent)

            });
